import React from 'react';

import './style.scss'

const ModalCell = (props) => {

	const closeModal = () => props.setModal(false);

	return (
		<div className="modal">
			<div className="modal-content">
				<h2>Sell the product</h2>
				<div className="close" onClick={closeModal}></div>
				<input type="text" placeholder="Number of products" />
				<input type="text" placeholder="Date of sale"/>
				<input type="submit" value="Sell product" className="btn addBtn" />
			</div>
		</div>
	);
};

export default ModalCell;
